import React, { Component } from 'react';
import User from './User';

export default class App extends Component {

    render() {   
        const arr = this.props.numbers 
        const newArr = arr.map(num =>{
            return <User number = {num}/>
        })    
        return (
            <div>
                <ul>{newArr}</ul>
            </div>
        );
               
                     
    }
}
